import React from "react";
import styled from "styled-components";
import Issue from "../../containers/Issue";

const Header = styled.div``;

const TopIssue = () => {
  return (
    <React.Fragment>
      <Header></Header>
      <Issue />
    </React.Fragment>
  );
};

export default TopIssue;
